import React from "react";
import BabyNamesData from "./BabyNamesData.json";

const Names = () => {
  const sortNames = BabyNamesData.sort((a, b) => (a.name > b.name ? 1 : -1));
  // console.log(sortNames);

  return (
    <div>
      <ul>
        {sortNames.map((x, i) => {
          return <li key={i} className>{x.name}</li>;
        })}
      </ul>
    </div>
  );
};
export default Names;
